import { iteratee } from 'lodash';
import { Link } from 'react-router-dom';

interface ItemDropDown {
  title: string,
  url: string,
}
interface ItemsDropDown {
  items: ItemDropDown[],
}

function NavDropDown({ items }: ItemsDropDown) {

  return (<>
    <Link to={'/a'}>{items[0].title}</Link>
  </>);
}
export default NavDropDown;
